import "./App.css";
import { useState } from "react";

import {
  BrowserRouter,
  Routes,
  Route,
  Router,

} from "react-router-dom";


import Home from "./components/Home";
import Search from "./components/Search";



function App() {

  return (
    <Routes>
      <Route path="/search" element={<Search />} />
      <Route path="/" element={<Home />} />


    </Routes>
  );
}

export default App;
